    - .debug_pubnames
    # DWARF 2
    - .debug_info
    # - .gnu.linkonce.wi.*
    - .debug_abbrev
    - .debug_line
    # - .debug_line.*
    - .debug_line_end
    - .debug_frame
    - .debug_str
    - .debug_loc
    - .debug_macinfo
    # SGI/MIPS DWARF 2 extensions
    - .debug_weaknames
    - .debug_funcnames
    - .debug_typenames
    - .debug_varnames
    # DWARF 3
    - .debug_pubtypes
    - .debug_ranges
    # DWARF 5
    - .debug_addr
    - .debug_line_str
    - .debug_loclists
    - .debug_macro
    - .debug_names
    - .debug_rnglists
    - .debug_str_offsets
    - .debug_sup
    # gnu attributes
    - .gnu.attributes
    # misc
    - .note
    - .comment
  sections_denylist:
    - .reginfo
    - .MIPS.abiflags
    - .MIPS.options
    - .note.gnu.build-id
    - .interp
    - .eh_frame

